Exclude a field during group stage of mongo aggregate pipeline but include it back at the end<p>I have a mongo aggregate query like below:</p>
<pre><code>
db.someCollection.aggregate([
  {
    $match: { taskId: &quot;qy7u17-xunwqu&quot; }
  },
  // Group by &quot;tracklet_id&quot; and calculate count for each group
  { 
    $group: {
      _id: '$tracklet_id',
      count: { $sum: 1 },
      representativeImage: { $first: '$img' }, // when I remove this, the query is done in a split second
      timestamp: { $max: '$timestamp' },
    },
  },
  {
    $project: {
      _id: 0,
      trackletId: '$_id',
      image: '$representativeImage', // but at the end, I want one representative image for a tracklet, doesn't matter which one.
      timestamp: 1,
      count: 1,
    },
  },
  { 
    $sort: {
      timestamp: -1
    }
  },
  {
    $limit: 20
  },

], {allowDiskUse: true})
</code></pre>
<p>the image field contains long b64 strings that take a lot of memory, causing the group and sort stage of the query to move to disk.
Is there a way that I can add a pipeline step before project to re-include an image field for each tracklet?</p>
<p>One alternative I can think of is to just do a separate query afterwards to get the images and combine the results, but I'm hoping there is a more elegant way to do it in the same aggregate query.</p>

