MongoDB: conditional updates to array fields in a single document<p>Context: I have created a service that deals with users data. I can not modify source and order of data in upstream system (usually it is a partial snapshot of a user or a delta (e.g. user's new post). I also must deal with duplicated information. I modeled my persistent layer around document db (MongoDB) using a single 'users' collection because I deal with independent users that do not have any relation, I don't need to update multiple tables and my read model is similar to my document's schema. I can always identify a user by his/her _id and login so whenever I need to update user's info I can update just a single document. Moreover usually I don't want to override user's data, but rather append it so a document creates a user's log. I just update it in the very rare case (when the data is nullable but will be updated only once (details) or I don't care about intermediate state (details.verified).</p>
<p>Problem: Whenever I receive an info about a given user, after matching it I want to check if the user should be modified and update it in a single atomic query/update. The problem is I may have several fields or array entries to check.</p>
<p>In a given example I want to:</p>
<ol>
<li>match a user with _id 123</li>
<li>add location entry to locations array only if in the last one location differs than the the one in the query.</li>
<li>A profile is very complex, thus I introduced a hash. I want to add a new profile entry only if the last hash differs than the one provided in the query.</li>
<li>Add a new post to posts array only if it does not contain a post with given postId.</li>
</ol>
<p>Another problem is that I can have e.g. just an information about a new post (that can also be a duplicate) for a given user, but it doesn't exist yet thus I need to upsert it.</p>
<p>So I want to cover few use cases that will update user's data in a single query, e.g.:</p>
<ul>
<li>a user not exist and we add it's details</li>
<li>we append a new post that is not yet persisted</li>
<li>we are trying to append a post that was already saved</li>
<li>we append a new post and check if location hasn't changed (and update it if needed)</li>
<li>we check if latest user's profile has changed by comparing hash and update it if needed and at the same time add info to user's details.</li>
</ul>
<p>Updates based on a single criteria seems to be strait forward. Without aggregation I can update a document with only one match criteria. Aggregation pipeline can contain several stages, but I am not certain I can use <strong>push</strong> stage to append to an array if certain criteria is met without a group stage. Upsert with conditional push is also problematic. I end up by ignoring DuplicateKeyException (so far without aggregation, because my service's logic relay on information if we deal with a duplicate). Maybe you know a better solution.</p>
<p><a href="https://www.mongodb.com/docs/manual/reference/operator/aggregation/push/" rel="nofollow noreferrer">https://www.mongodb.com/docs/manual/reference/operator/aggregation/push/</a></p>
<p>A question if this approach is doable? I want to avoid replacing a document. I would be appreciate for some guideline and/or example queries.</p>
<p>A simplified document:</p>
<pre><code>[
  {
    &quot;_id&quot;: 123,
    &quot;login&quot;: &quot;john&quot;,
    &quot;details&quot;: {
      &quot;a&quot;: &quot;abc&quot;,
      &quot;verified&quot;: true
    },
    &quot;locations&quot;: [
      {
        &quot;location&quot;: {
          &quot;country&quot;: &quot;UK&quot;,
          &quot;region&quot;: &quot;foo&quot;,
          &quot;city&quot;: &quot;bar&quot;
        },
        &quot;createdAt&quot;: ISODate(&quot;2020-01-22T21:21:41.052Z&quot;)
      }
    ],
    &quot;profiles&quot;: [
      {
        &quot;preference&quot;: {
          &quot;a&quot;: &quot;foo&quot;,
          &quot;b&quot;: &quot;bar&quot;
        },
        &quot;details&quot;: {
          &quot;a&quot;: &quot;foo&quot;,
          &quot;b&quot;: &quot;bar&quot;
        },
        &quot;hash&quot;: &quot;hash123&quot;,
        &quot;createdAt&quot;: ISODate(&quot;2020-01-22T21:21:41.052Z&quot;)
      }
    ],
    &quot;posts&quot;: [
      {
        &quot;postId&quot;: 234,
        &quot;message&quot;: &quot;foo bar&quot;,
        &quot;createdAt&quot;: ISODate(&quot;2020-01-22T21:21:41.052Z&quot;)
      },
      {
        &quot;postId&quot;: 345,
        &quot;message&quot;: &quot;bar foo&quot;,
        &quot;createdAt&quot;: ISODate(&quot;2020-01-22T21:21:41.052Z&quot;)
      }
    ]
  }
]
</code></pre>
<p><a href="https://mongoplayground.net/p/UsS72apI23F" rel="nofollow noreferrer">https://mongoplayground.net/p/UsS72apI23F</a></p>

